import logo from './logo.svg';
import './App.css';
import { Home } from './Components/Home';
import {Routes , Route} from "react-router-dom"
import { Cart } from './Components/Cart';
function App() {
  return (
    <div className="App">
       <Home />

       <Routes>
                <Route path="/" element={<Home />}></Route>
                <Route path="/Cart" element={<Cart />}></Route>

       </Routes>
    </div>
  );
}

export default App;
